import React, {useState, useEffect, Fragment} from 'react';
import axios from 'axios';
import {useParams} from 'react-router-dom';

function Home() {
    const url = 'https://iot.fvh.fi/opendata/uiras/uiras-meta.json'
    const [beaches, setBeaches] = useState([])

    useEffect(() => {
        axios.get(url)
            .then(response => {
                setBeaches(response.data)
        })
            .catch((err) => {
                console.log(err)
            })
    }, [])

    return (
        <Fragment>
            <h1>Beaches near me</h1>

            {beaches.map((beach) => (
                <div key = {beach.name}> {beach.name} </div>        
            ))}
        </Fragment>
    )
}

export default Home
